export default createStore({
    state: {
        productID: 0,
        Order: {},
        counter: 0,
        prname: "",
        products: [],
        companyname: "",
        companyid: 0,
        categoryid: 0,
    },
    getters: {},
    mutations: {},
    actions: {},
    modules: {},
});
